import React from 'react'
import Instructor from "../../../assets/Images/Instructor.png"
import HighlightText from './HighlightText'
const InstructorSection = () => {
  return (
    <div className='py-10 w-11/12 bg-yellow-5 mx-auto max-w-maxContent flex items-center gap-20'>
      {/* image */}
      <div>
        <img className=' shadow-instructorimageshadow' src={Instructor}></img>
      </div>
      {/* text and button */}
      <div>
        <div className=' font-inter text-[36px] font-semibold leading-[44px] tracking-[-0.72px] text-[#F1F2FF]'>Become an</div>
        <HighlightText className='font-inter text-[36px] font-semibold leading-[44px] tracking-[-0.72px]' text={"instructor"}></HighlightText>
      </div>
    </div>
  )
}

export default InstructorSection
